// App.js
import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import SimpleQuestion from './SimpleQuestion';
import CompatibilityTab from './CompatibilityTab';
import Logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <img src={Logo} className="App-logo" alt="logo" />
        <h1>Voiance</h1>

        {/* Ajoutez la navigation ici */}
        <nav>
          <ul>
            <li>
              <Link to="/">Voyance</Link>
            </li>
            <li>
              <Link to="/compatibilite">Compatibilité</Link>
            </li>
          </ul>
        </nav>

        {/* Mettez à jour le contenu principal ici */}
        <Switch>
          <Route exact path="/">
            <SimpleQuestion />
          </Route>
          <Route path="/compatibilite">
            <CompatibilityTab />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
